import React from "react";

const SignUp = () => {
    return (
        <div>
            <h1>Register</h1>
            <input type="text" placeholder="Enter Name" />
            <input type="text" placeholder="Enter E-mail" />
            <input type="text" placeholder="Enter Password" />
        </div>
    );
}

export default SignUp;
